import React, { useState } from 'react';
import ReactFlow, {
  MiniMap,
  Controls,
  Background,
  useNodesState,
  useEdgesState,
} from 'reactflow';

import 'reactflow/dist/style.css';

const initialNodes = [
  {
    id: 'start',
    position: { x: 300, y: 50 },
    data: { label: 'Start Node' },
    style: {
      background: '#ffffff',
      padding: 10,
      borderRadius: 10,
      color: 'black',
      border: '1px solid #000000',
    },
  },
  {
    id: 'add-node-button',
    position: { x: 300, y: 200 },
    data: { label: '+' },
    style: {
      background: '#007bff',
      color: 'white',
      padding: 10,
      borderRadius: 10,
      textAlign: 'center',
      cursor: 'pointer',
    },
  },
  {
    id: 'end',
    position: { x: 300, y: 400 },
    data: { label: 'End Node' },
    style: {
      background: '#ffffff',
      padding: 10,
      borderRadius: 10,
      color: 'black',
      border: '1px solid #000000',
    },
  },
];

const initialEdges = [
  { id: 'start->add-node-button', source: 'start', target: 'add-node-button', type: 'smoothstep' },
  { id: 'add-node-button->end', source: 'add-node-button', target: 'end', type: 'smoothstep' },
];

export default function App() {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);
  const [nodeCount, setNodeCount] = useState(1); // To generate unique node IDs
  const [showNodeTypeSelector, setShowNodeTypeSelector] = useState(false); // To toggle the node type selector
  const [currentAddNodeId, setCurrentAddNodeId] = useState('add-node-button'); // Track the current "Add Node Button"

  // Function to handle adding a new node
  const addNodeHandler = (type) => {
    const newNodeId = `action-node-${nodeCount}`;
    const newAddNodeId = `add-node-button-${nodeCount}`;
    const newNode = {
      id: newNodeId,
      position: { x: 300, y: nodes.find((node) => node.id === currentAddNodeId).position.y + 100 },
      data: { label: `Action Node ${nodeCount}` },
      style: {
        background: '#a0d911', // Green background for Action Node
        padding: 10,
        borderRadius: 10,
        color: 'black',
        border: '1px solid #000000',
      },
    };

    const newAddNode = {
      id: newAddNodeId,
      position: { x: 300, y: newNode.position.y + 100 },
      data: { label: '+' },
      style: {
        background: '#007bff',
        color: 'white',
        padding: 10,
        borderRadius: 10,
        textAlign: 'center',
        cursor: 'pointer',
      },
    };

    // Add the new node and the new "Add Node Button"
    setNodes((nds) => {
      const updatedNodes = nds.filter((node) => node.id !== currentAddNodeId); // Remove the current "Add Node Button"
      return [...updatedNodes, newNode, newAddNode];
    });

    // Update edges
    setEdges((eds) => {
      const updatedEdges = eds.filter(
        (edge) => edge.source !== currentAddNodeId && edge.target !== 'end'
      );
      return [
        ...updatedEdges,
        {
          id: `e-${currentAddNodeId}-${newNodeId}`,
          source: currentAddNodeId,
          target: newNodeId,
          type: 'smoothstep',
        },
        {
          id: `e-${newNodeId}-${newAddNodeId}`,
          source: newNodeId,
          target: newAddNodeId,
          type: 'smoothstep',
        },
        {
          id: `e-${newAddNodeId}-end`,
          source: newAddNodeId,
          target: 'end',
          type: 'smoothstep',
        },
      ];
    });

    // Update state
    setNodeCount(nodeCount + 1);
    setCurrentAddNodeId(newAddNodeId); // Update the current "Add Node Button"
    setShowNodeTypeSelector(false); // Hide the node type selector
  };

  return (
    <div style={{ width: '100vw', height: '100vh' }}>
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        fitView
      >
        <Controls />
        <MiniMap />
        <Background variant="dots" gap={12} size={1} />
      </ReactFlow>

      {/* Add Node Button */}
      <button
        onClick={() => setShowNodeTypeSelector(true)}
        style={{
          position: 'absolute',
          top: '20px',
          left: '20px',
          padding: '10px',
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
        }}
      >
        Add Node
      </button>

      {/* Node Type Selector */}
      {showNodeTypeSelector && (
        <div
          style={{
            position: 'absolute',
            top: '60px',
            left: '20px',
            padding: '10px',
            backgroundColor: 'white',
            border: '1px solid #ccc',
            borderRadius: '5px',
            boxShadow: '0 2px 5px rgba(0, 0, 0, 0.2)',
          }}
        >
          <p style={{ margin: '0 0 10px', fontWeight: 'bold' }}>
            Select Node Type:
          </p>
          <button
            onClick={() => addNodeHandler('action')}
            style={{
              display: 'block',
              width: '100%',
              padding: '10px',
              marginBottom: '5px',
              backgroundColor: '#a0d911',
              color: 'white',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
            }}
          >
            Action Node
          </button>
        </div>
      )}
    </div>
  );
}
